import { useState } from 'react'
import Header from './components/Header'
import Weekdays from './components/Weekdays'

const App = () => {
const [weekdays, setWeather] = useState(
  [
    {
      id: 1,
      weatherType: 'Rainy',
      day: 'Sunday',
      picture: null,
    },
    {
      id: 2,
      weatherType: 'Sunny',
      day: 'Monday',
      picture: null,
    },
    {
      id: 3,
      weatherType: 'Cloudy',
      day: 'Tuesday',
      picture: null,
    }
  ]
)
  return (
    <div className="container">
      <Header />
      {weekdays.length > 0 ? (
      <Weekdays weekdays={weekdays} />
      ) : (
        'Not working'
      )}
    </div>
  )
}

export default App;
